import SignUp from "./SignUp";
import Login from "./Login";
import '../CSSContents/Profile.css'

function Profile() {




    return (
        <div className='Profile'>
            <button onChange={<SignUp />}> SignUp Now</button>
            <button> Login</button>
            <SignUp />
            <Login />

        </div >
    )
}

export default Profile;
